Male genitalia (
Fig. 4F
):

Tegumen without narrowing; uncus elongate, without pair of prominent parallel lobes but terminated by pair of small, hook-like, dorsoapical processes; vinculum narrow, elongate; saccus small, triangular; valva evenly sclerotized, gradually narrowed towards sharp tip; phallus almost straight, widening towards apex, dorsal, terminal portion without area of minute cornuti; vesica well developed in form of pair of membranous pouches everted anteriorly (
Fig. 5F, I
).
